    const [book, setBook] = useState([])

    useEffect(()=>{
        axios.get('htt[://localhost:8081/read'+id)
        .then(res => {console.log(res)
            setBook(res.data);
        })
        .catch(err=> console.log(err))
    }, [])
    return(
        <div>Read</div>
    )
}

